import React from 'react'
import styles from './RandomNewsFeeed.module.css'

function RandomNewsFeed(props) {
    return (
        <ul>
            {props.feed.map((feeds) => (
                <div 
                className={styles.card}
                 id={feeds.id}>
                    <h1>{feeds.title}</h1>
                    <h3>{feeds.content}</h3>
                    <h3><a href={feeds.url}>Read More</a></h3>
                    <div>
                        <img src={feeds.image} />
                    </div>
                    <h3>{feeds.source}</h3>
                </div>

            ))}
        </ul>
    )
}

export default RandomNewsFeed
